package BasicConcept;

public class LogicalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println((5>3) && (5<8));
		System.out.println((5>3) && (5>8));
		System.out.println((5<3) || (5>8));
		System.out.println((5<3) || (5<8));
		System.out.println((5>3) || (5<8));
		
		System.out.println(!(5==3));
	}

}
